keyframes.progress-bar-animated:
@keyframes progress-bar-animated {
  0% {
    width: 0%;
    opacity: 0.3;
    filter: alpha(opacity=30);
  }

  20% {
    width: 40%;
  }

  30% {
    width: 45%;
  }

  40% {
    width: 55%;
  }

  50% {
    width: 68%;
  }

  65% {
    opacity: 0.3;
    filter: alpha(opacity=30);
  }

  100% {
    width: 100%;
    opacity: 0;
    filter: alpha(opacity=0);
  }
}

keyframes.progress-bar-indeterminate:
@keyframes progress-bar-indeterminate {
  0% {
    width: 20%;
    margin-left: 0%;
  }

  80% {
    width: 35%;
    margin-left: 65%;
  }

  100% {
    width: 0%;
    margin-left: 100%;
  }
}

keyframes.table-row-fadein:
@keyframes table-row-fadein {
  from {
    background-color: transparent;
  }

  to {
    background-color: #cceaf5;
  }
}

keyframes.table-row-fadeout:
@keyframes table-row-fadeout {
  from {
    background-color: #cceaf5;
  }

  to {
    background-color: transparent;
  }
}

